import React from 'react';
import './css/Navbar.css';

const Navbar = () => {
    return(
        <nav className="main_navigation">

            <ul>
                <li><a class="home" href="/">Home</a></li>
                <li><a class="live_locations" href="/livelocation">Live Locations</a></li>
                <li><a class="heatmap" href="/heatmap">Heatmap</a></li>
                <li><a class="usertraces" href="/usertrace">User Trace</a></li>
            </ul>

        </nav>
    )
}

export default Navbar
